package com.nec.asia.nic.investigation.controller;

public class FraudCaseManagementDocumentData {

	String applicationId;
	String passportNumber;
	String passportStatus;
	String passportStatusDescription;
	String passportTypeDescription;

	public FraudCaseManagementDocumentData() {
		super();
		// TODO Auto-generated constructor stub
	}

	public FraudCaseManagementDocumentData(String applicationId, String passportNumber, String passportStatus,
			String passportStatusDescription, String passportTypeDescription) {
		super();
		this.applicationId = applicationId;
		this.passportNumber = passportNumber;
		this.passportStatus = passportStatus;
		this.passportStatusDescription = passportStatusDescription;
		this.passportTypeDescription = passportTypeDescription;
	}

	public String getApplicationId() {
		return applicationId;
	}

	public void setApplicationId(String applicationId) {
		this.applicationId = applicationId;
	}

	public String getPassportNumber() {
		return passportNumber;
	}

	public void setPassportNumber(String passportNumber) {
		this.passportNumber = passportNumber;
	}

	public String getPassportStatus() {
		return passportStatus;
	}

	public void setPassportStatus(String passportStatus) {
		this.passportStatus = passportStatus;
	}

	public String getPassportStatusDescription() {
		return passportStatusDescription;
	}

	public void setPassportStatusDescription(String passportStatusDescription) {
		this.passportStatusDescription = passportStatusDescription;
	}

	public String getPassportTypeDescription() {
		return passportTypeDescription;
	}

	public void setPassportTypeDescription(String passportTypeDescription) {
		this.passportTypeDescription = passportTypeDescription;
	}
}
